import React from "react";
import CardAddOrderStyle from "./CardAddOrderStyle"



class CardAddOrder extends React.PureComponent {
    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
        };
      }



      render() {
        return (
            <CardAddOrderStyle>
                <div style={{borderBottom: "1px solid #D0D0D0", display: "flex",flexDirection: "row",
  justifyContent: "center",direction: "ltr"}}>
                    <p style={{padding: "0",margin: "0"}}>Title</p>
                </div>
                <div style={{display: "flex", direction:"ltr", alignItems: "center"}}>
                  <ul style={{width: "80%", margin:"0"}}>
                      <li>
                          <p style={{padding: "0",margin: "0"}}>50</p>
                      </li>
                      <li style={{height: ".25rem", boxShadow: "0 .125rem 0 0 #f6f7fb",transition: "all .12s cubic-bezier(.47,0,.745,.715)"}}>

                      </li>
                      <li style={{color:"#c3c7d5", textAlign: "inherit",fontWeight: "600",fontSize: ".75rem", letterSpacing: ".0625rem",lineHeight: "1.333333333333333"}}>
                          Количество
                      </li>
                  </ul>
                  <ul style={{width: "20%"}}>+</ul>
                </div>
            </CardAddOrderStyle>
        )
      }
}


export default CardAddOrder;
